import React, { Component } from 'react';

import { todos } from '../jodos.json';
console.log(todos);

class Navigation extends Component {

    constructor() {
        super();
        this.state = {
            todos
        }
    }

    render() {
        this.state.todos.map((todo, i) => {
            return (
                <div className="card">
                    {todo.title}
                </div>
            )
        })

        return (
            <div className="col-6">
                <p className="text">
                    tareas
                </p>
            </div>
        )
    }
}

export default Navigation;
